export const fetchData = async () => {
  if(type === 'allPost') {
    try {
      const response = await fetch("https://jsonplaceholder.typicode.com/posts/"+params);
      const data = await response.json();
      return data;
    } catch (e) {
      console.log(e);
    }
  } else {
    try {
      const response = await fetch("https://jsonplaceholder.typicode.com/posts");
      const data = await response.json();
      return data;
    } catch (e) {
      console.log(e);
    }
  }
};
